const App = () => {
  const [loggedIn, setloggedIn] = useState()

  const changeLoggedIn = (state) => setloggedIn(state)


  return (
    <Router>
<AppMenu loggedIn={loggedIn} changeLoggedIn={changeLoggedIn} />

      <div className="App">
        {/* //         <ul className="links"> */}
        <AppHeader loggedIn={loggedIn} changeLoggedIn={changeLoggedIn} />

